            name: exercise.name,
            reps: exercise.reps,
            sets: exercise.sets,
            key: `exercise${index + 1}`, // Assign a unique key for each exercise
          })),
        })
          .then(() => {
            console.log("Workout added successfully!");
            closeCreateWorkoutModal();
          })
          .catch((error) => {
            console.error("Error adding workout: ", error);
          });
